import React, { Component } from 'react'
import Container from 'react-bootstrap/Container'
import ProjectService from '../service/ProjectService.jsx'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Button from 'react-bootstrap/Button'

class UnitComponent extends Component {

    constructor(props) {
        super(props)

        this.state = {
            unit: '',
            loadInList: [],
            buildList: [],
            materials: [],
            owner: this.props.location.state.owner,
            projectId: this.props.match.params.id
        }

        this.handleChange = this.handleChange.bind(this)
    }

    handleChange(event) {
        this.setState(
            {[event.target.name]: event.target.value}
        )
    }

    componentDidMount() {
        this.refreshUnit();
    }

    refreshUnit() {
        ProjectService.retrieveUnit(this.props.location.state.unitId, this.state.projectId)
            .then(
                response => {
                    this.setState({ unit: response.data })
                    this.setState({ loadInList:  response.data.subcomponents.filter(subcom => subcom.type === "LOAD_IN")})
                    this.setState({ buildList:  response.data.subcomponents.filter(subcom => subcom.type === "BUILD")})
                    this.setState({ materials: response.data.materials })
                }
            )
    }

    deleteUnitClicked() {
        ProjectService
        .deleteUnit(this.state.unit.id, this.state.projectId)
        .then((response) => {
            if (response.data.success) {
                console.log("unit was deleted successfully")
                this.props.history.goBack()
            } else {
                console.log("unit was not deleted succuessfully")
            }

        }).catch(() => {
            console.log("unit delete failed")
        }) 
    }

    markAllFinishedClicked() {
        console.log("mark all complete clicked")
        ProjectService
        .markAllSubcomponentsComplete(true, this.state.unit.id)
        .then((response) => {
            if (response.data.success) {
                console.log("Marked all subcomponents complete")
                this.refreshUnit()
                this.props.history.goBack()
            } else {
                console.log("Marking all subcomponents complete was not successful")
            }

        }).catch(() => {
            console.log("Mark all complete failed")
        }) 
    }

    render() {

        return (
            <Container className="mt-3">

                <h2 className="border-bottom-custom">{this.state.unit.name}</h2>

                <Row className="mt-3">
                    <Col xs={6}/>
                    {this.state.owner ? (
                    <Col xs={3}>
                        <Button block variant="danger" onClick={this.deleteUnitClicked.bind(this)}>Delete Unit</Button>
                    </Col> ) : (
                    <Col xs={3}/>
                    )}
                    <Col xs={3}>
                        <Button block variant="success" onClick={this.markAllFinishedClicked.bind(this)}>Mark All Finished</Button>
                    </Col>
                </Row>

                <h4 className="border-bottom-custom">Description</h4>
                <p>{this.state.unit.description}</p>

                <h4 className="border-bottom-custom">Build</h4>
                {this.state.buildList.map(
                        build =>
                        <p>Build {build.name}</p>
                    )
                }

                <h4 className="border-bottom-custom">Load in</h4>
                {this.state.loadInList.map(
                        loadIn =>
                        <>
                        {/* loadIn.finished ? (<Col className="border-bottom-custom">)
                        : (<Col className="border-bottom-custom">) */}
                        <Col className="border-done" style={{color: "red"}}>
                        <p>{loadIn.name}</p>
                        <p>Description {loadIn.description}</p>
                        <p>Work Hours {loadIn.workHours}</p>
                        <p>Number of Crew {loadIn.numberOfCrew}</p>
                        </Col>
                        </>
                    )
                }

                <h4 className="border-bottom-custom">Materials</h4>
                {this.state.materials.map(
                        material =>
                        <>
                        <p>material {material.name}</p>
                        <p>material cost {material.cost}</p>
                        <p>material amount required {material.amountRequired}</p>
                        <p>vendor {material.vendor}</p>
                        </>
                    )
                } 


            </Container>
        )
    }
}

export default UnitComponent
